import React from "react";
import "./Layout.css";

const Layout = (props) => {
  return (
    <div className="themain">
      <nav>
        <div>
          <h1 className="logo">GroceryList</h1>
        </div>
        <ul>
          <li>Home</li>
          <li>Your List</li>
          <span>{props.numberItems}</span>
        </ul>
      </nav>
      <div className="container">{props.children}</div>
    </div>
  );
};

export default Layout;
